import React, {useState}from 'react';
import { View, Text, StyleSheet, TextInput } from 'react-native';

const TextScreen = () => {

    return (
<View>

    <TextInput 
    style={styles.input}/>
    autoCapitalize="none"
    autoCorrect={false}
</View>

    );
};

const styles = StyleSheet.create({
    input: {
        margin: 15,
        height: 25,
        borderColor: 'black',
        borderWidth: 1
    }
});

export default TextScreen;
